import React from 'react';
import FoodOption from 'components/foodOption/foodOption';

interface CarrinhoProps {
  foodOptions: FoodOptionProps[];
}

interface FoodOptionProps {
  image: string;
  title: string;
  onCartButtonClick: () => void;
  price: string;
  cartButtonText: string;
}

const Carrinho: React.FC<CarrinhoProps> = ({ foodOptions }) => {
  return (
    <div>
      <h1>Carrinho</h1>
      {foodOptions.map((foodOption, index) => (
        <FoodOption
          key={index}
          image={foodOption.image}
          title={foodOption.title}
          onCartButtonClick={foodOption.onCartButtonClick}
          price={foodOption.price}
          cartButtonText={foodOption.cartButtonText}
        />
      ))}
    </div>
  );
};

export default Carrinho;
